function StarshipsList(props) {
    return (
    <div className = "grid">
    {
    props.starships.map((starship) => (
        <div key={starship.model} className="card">
            <h3> {starship.name}</h3>
        </div>
    ))
    }
    </div>
    )
}

export default StarshipsList;
